INSERT INTO `mklasifikasisub` (`idmklasifikasisub`, `parametersub`, `indeks`, `keterangan`, `idmklas`) VALUES
	(1, 'Sederhana', 0.4, 'Bangunan gedung dengan karakter sederhana dan memiliki kompleksitas dan teknologi sederhana, antara lain :', 1),
	(2, 'Tidak Sederhana', 0.7, 'Bangunan gedung dengan karakter sederhana dan memiliki kompleksitas dan teknologi tidak sederhana antara lain :\r\n\r\nBangunan gedung yang belum ada disain prototipenya dan / atau yang jumlah lantainya di atas 2 (dua) lantai dengan luas di atas 500 m2;\r\n\r\nBangunan rumah tidak bertingkat, dengan luas di atas 70 m2.', 1),
	(3, 'Khusus', 1, 'Bangunan gedung yang memiliki penggunaan dan persyaratan khusus, yang dalam perencanaan dan pelaksanaannya memerlukan penyelesaian/teknologi khusus, antara lain : gedung laboratorium, terminal udara/laut/darat, stasiun kereta api, stadion olah raga, rumah tahanan dan lembaga pemasyarakatan (lapas), dan gudang penyimpanan bahan berbahaya;', 1),
	(4, 'Darurat', 0.4, 'Bangunan gedung yang mempunyai umur layanan sampai dengan 5 (lima) tahun.', 2),
